  return (
    <div className="App">
      <Header />
      <div className="content">
        <NavigationMenu />
        <div className="main-content">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Esteban Barrera's Portfolio
          </p>
          <a
            className="App-link"
            href="https://github.com/Wolfban"
            target="_blank"
            rel="noopener noreferrer"
          >
            My Github
          </a>
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default App;
